public void bindToArrayShouldReturnPrimitiveArray() throws Exception {
	MockConfigurationPropertySource source = new MockConfigurationPropertySource();
	source.put("foo[0]", "1");
	source.put("foo[1]", "2");
	source.put("foo[2]", "3");
